    return [
      {
        id: 1,
        title: "Задача",
        completed: false,
      },
      {
        id: 2,
        title: "Задача",
        completed: true,
      },
      {
        id: 3,
        title: "Задача",
        completed: false,
      },
    ]
  }, [])

  useEffect(() => {
    console.log("meow")
  }, [toDoImitate])

  return (
    <StyledHomeWork35>
      <TaskForm></TaskForm>
      <List>
        {toDoImitate.map((item) => {
          return (
            <ToDoListItem
              key={item.id}
              object={item}
            />
          )
        })}
      </List>
    </StyledHomeWork35>
  )
}
